import React,{ useEffect, useState } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  const [todolist, settodo] = useState([]);

  useEffect( () => {
    axios.get('todos')
      .then(res => {
        settodo(res.data);
      })
      .catch(err => {
        console.log(err)
      })

  },[])
  return (
    <div>
        {
          todolist.map(data => <p key={data.id}>{data.title}</p>)
        }
    </div>
  );
}

export default App;
